{'chat_history': [{'message': "Hi there! I'm John. How can I assist you today with your loan needs?", 'user_role': 'advisor'}, {'message': "Hi John, I'm Shannon Walker. I'm looking to apply for a personal loan to help clear my credit card debt and perhaps cover some medical expenses. Could you guide me through the process?", 'user_role': 'customer'}, {'message': "Of course, Shannon! A personal loan sounds like a suitable option for your needs. Let's start with some basic information. Could you please confirm your first and last name for the record?", 'user_role': 'advisor'}, {'message': 'Yes, my first name is Shannon and my last name is Walker.', 'user_role': 'customer'}, {'message': 'Thank you, Shannon. Next, could you share your date of birth, please?', 'user_role': 'advisor'}, {'message': 'Sure, my date of birth is November 5, 1990.', 'user_role': 'customer'}, {'message': 'Great, thanks for that. Can I also have your contact details, including your address and email?', 'user_role': 'advisor'}, {'message': 'My address is 9816 Jonathan Station Suite 088 West Ryan, TN 43780. As for my email, I prefer to keep that private for now, but I can provide it later if needed.', 'user_role': 'customer'}, {'message': "That's perfectly fine, Shannon. Let me know when you're ready to share it. Now, let's talk about your agreed loan amount. How much are you looking to borrow for the personal loan?", 'user_role': 'advisor'}, {'message': "I'm looking to borrow around $10,000. That should cover my credit card debt and some medical expenses.", 'user_role': 'customer'}, {'message': 'Got it, $10,000. Now, could you provide your credit score? This helps us determine the loan terms we can offer.', 'user_role': 'advisor'}, {'message': 'My credit score is 650.', 'user_role': 'customer'}, {'message': "Thank you for providing your credit score, Shannon. Now we need some verification documents. Let's start with an ID proof�could you share what document you can provide for that?", 'user_role': 'advisor'}, {'message': "Here's my driver's license.. <IMAGE-URI: https:/<>.core.windows.net/images/image_e66eb6f9-dfec-4def-a6ad-0a686dcf9ab2.jpg?st=2025-05-20T19%3A28%3A35Z&se=2025-05-21T19%3A28%3A35Z&sp=r&sv=2023-11-03&sr=b&skoid=bcf46e01-d872-4207-91a1-0513e54d4dca&sktid=72f988bf-86f1-41af-91ab-2d7cd011db47&skt=2025-05-20T19%3A28%3A35Z&ske=2025-05-21T19%3A28%3A35Z&sks=b&skv=2023-11-03&sig=%2BNPu5iI%2BGPzz1wo5yJrPZPNAiM2//jZbJmyEK8LHIJ4%3D>", 'user_role': 'customer'}, {'message': "Received your driver's license. This might take a few minutes to process. Lastly, could you provide a utility bill for address verification?", 'user_role': 'advisor'}, {'message': "Here's my water bill.. <IMAGE-URI: https://<>.windows.net/images/image_143241b2-4c63-4580-839c-7b714aa6f84d.jpg?st=2025-05-20T19%3A29%3A10Z&se=2025-05-21T19%3A29%3A10Z&sp=r&sv=2023-11-03&sr=b&skoid=bcf46e01-d872-4207-91a1-0513e54d4dca&sktid=72f988bf-86f1-41af-91ab-2d7cd011db47&skt=2025-05-20T19%3A29%3A10Z&ske=2025-05-21T19%3A29%3A10Z&sks=b&skv=2023-11-03&sig=PrM4w7Kqqp2WWWL%2BwrzoAhutSnR6qgQENNkSOpss/Nc%3D>", 'user_role': 'customer'}, {'message': "Thank you, I've received your water bill for verification. Shannon, your application is now complete! If we need any more information, I'll reach out to you. Otherwise, you'll hear from us once your application is processed. If you have any other questions, feel free to ask!", 'user_role': 'advisor'}, {'message': "Thank you, John. I'm looking forward to hearing back. Goodbye!", 'user_role': 'customer'}], 'completed_form': '{
